description:
Cinema Obscura (Vivid) [DVDRip]

Holly Hollywood, Lola, Malezia

Malezia in her first Vivid feature Leo is a director who no longer has it in him to make personal movies like he used to.
He's desperately in need of a muse, and he finds one, in the form of Debra, a beautiful journalist.
This is their story and just as importantly, this is the introduction of beautiful Malezia - a muse if we ever did see one.
Malezia - amuse yourself with Cinema Obscura, only from Vivid.

